import { useContext } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import MetaContext from "../MetaContext";
import { Logout, Login } from "./HomePage/LoginLogout";

type NavigatorProps = {
    selection: string;
};

const Navigator = (props: NavigatorProps) => {
    const { token, setToken } = useContext(MetaContext);

    const options = [
        { title: "Home", path: "/User", av: true },
        { title: "OSCE", path: "/OSCE", av: true },
        { title: "MedBook", path: "/User", av: false },
        { title: "QBank", path: "/User", av: false },
    ];

    return (
        <>
            <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                <LogoTitle>
                    <Link to="/">
                        <h1>MedBakery</h1>
                    </Link>
                </LogoTitle>
                {token ? <Logout darkMode={true} setToken={setToken} /> : <Login label="Login" />}
            </div>

            <div style={{ borderBottom: "0.5px solid grey" }}>
                <div style={{ display: "flex", marginLeft: "5%" }}>
                    {options.map(({ title, path, av }) => (
                        <Link to={av ? path : "#"}>
                            <Option av={av} selected={title === props.selection}>
                                {" "}
                                {title}{" "}
                            </Option>
                        </Link>
                    ))}
                </div>
            </div>
        </>
    );
};

const LogoTitle = styled.div`
    margin: 30px 5%;
`;

const Option = styled.div<{ av: boolean; selected: boolean }>`
    padding: 15px;
    background-color: ${props => (props.selected ? "#2f3237" : "none")};
    text-decoration: ${props => (props.av ? "none" : "line-through")};
    color: ${props => (props.selected ? "#fad000" : "white")};
`;

export default Navigator;
